import React, { Component } from 'react';
// import { Link } from 'react-router-dom'
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
// import '../'

class CreateProfile extends Component {
	constructor(props) {
		super(props);
			this.state = {
				pet_name: '',
					pet_breed: '',
					pet_age: '',
					pet_type: ''
        }
			this.handleInputChange = this.handleInputChange.bind(this)
			this.addProfile = this.addProfile.bind(this)
	}

	componentDidMount() {
		if(!this.props.auth.isAuthenticated) {
			this.props.history.push('/login')
		}
	}

	handleInputChange(e) {
		this.setState({
			[e.target.name]: e.target.value
		})
	}

	addProfile(e) {
		e.preventDefault()
		console.log(this.state)
	}

	render() { 
		return ( 
			<div className="main-dasboard">
				<div className="container mt-5">
					<div className="card dash-main-card">
						<div className="card-header">
							<label>Create Pet Profile</label>
						</div>
						<div className="card-body">
							<div className="container">
								<div className="row">
									<div className="col">
										<form>
											<div className="form-group col-md-6">
												<label>Pet Name</label>
												<input
													type="text"
													className="form-control"
													id="pet_name"
													name="pet_name"
													placeholder="Pet Name"
													defaultValue={ this.state.pet_name }
													onChange={ this.handleInputChange }
												/>
											</div>
											<div className="form-group col-md-6">
												<label>Pet Type</label>
													<select
														id="pet_type"
														className="form-control"
														defaultValue="0"
														name="pet_type"
														onChange={ this.handleInputChange }
													>
														<option value="0">Pet Type</option>
														<option value="dog">Dog</option>
													</select>
											</div>
											<div className="form-group col-md-6">
												<label>Pet Breed</label>
												<input
													type="text"
													className="form-control"
													id="pet_breed"
													name="pet_breed"
													placeholder="Pet Breed"
													defaultValue={ this.state.pet_breed }
													onChange={ this.handleInputChange }
												/>
											</div>
											<div className="form-group col-md-6">
												<label>Age</label>
												<input
													type="text"
													className="form-control"
													id="pet_age"
													name="pet_age"
													placeholder="Age"
													defaultValue={ this.state.pet_age }
													onChange={ this.handleInputChange }
												/>
											</div>
											<button onClick={ this.addProfile }className="btn btn-primary">Next</button>
										</form>
									</div>
								</div>
							</div>
						</div>
					</div>
				</div>
			</div>

		)
	}
}

CreateProfile.propTypes = {
	auth: PropTypes.object.isRequired,
}

const mapStateToProps = (state) => ({
	auth: state.auth,
})

export default connect(mapStateToProps)(CreateProfile)
